    is a component of the all-items CPI. The CPI measures the average change over time
    in the prices paid by urban consumers for a representative market basket of consumer
    goods and services. While the all-items CPI measures the price changes for all consumer
    goods and services, including food, the CPI for food measures the changes in the
    retail prices of food items only.",nt"license_title": "Creative Commons CCZero",nt"extras":
